import DegreeFilterOption from './DegreeFilterOption'
import { ButtonToolbar } from 'react-bootstrap'

const DegreeFilterCard = () => {

    const degreeList = [
        'Computer Science', 'Psychology', 'Biology', 'Physics', 'Mathematics', 'Grass Science'
    ]


    return (
        <>
            <ButtonToolbar>
                {degreeList.map((degree) => (
                    <DegreeFilterOption text={degree}/>
                ))}
            </ButtonToolbar>
        </>
    )
}

export default DegreeFilterCard
